import { View, Text, StyleSheet } from "react-native"

const Forgot = () => {  
    return (
        <View style={styles.container}>
        <Text>Owner Main</Text>
        </View>
    )
}

export default Forgot

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    }
});
